# Nõmme linnaosa vanem

## Sissejuhatus

Nõmme on Tallinna linnaosa, mis asub linnast kaguservas. 2017. aastast on Nõmme linnaosa valitsuslikuks üksuseks Nõmme linnaosa vanem, kes on Tallinna linnavalitsuse esindaja Nõmme linnaosas. 2022. aasta 15. juunist on Nõmme linnaosa vanem Karmo Kuri.

## Ajalugu

Nõmme linnaosa vanem on ametis alates 2017. aastast. Aadressil Toompea 18 asus Tallinna linnapea, tellimuse alusel.

## Ülesanded

Nõmme linnaosa vanem on ülesannetega vastutav Tallinna linnavalitsuse esindaja Nõmme linnaosas. Linnaosa vanem on ülesannetega:

* Nõmme linnaosa arengukava täitmine;
* Nõmme linnaosa toimimise tagamiseks vajalike tegevuste korraldamine;
* Nõmme linnaosa elanike huvid kaitsmine;
* Nõmme linnaosa majanduslik ja sotsiaalne areng;
* Nõmme linnaosa võrgukeskkonnad ja tervise teenused;
* Nõmme linnaosa ühiskonnatöö.

## Karmo Kuri

Nõmme linnaosa vanem on Karmo Kuri. Karmo Kuri on Tallinna linnapea, kes on ülesannetega vastutav Tallinna linnavalitsuse esindaja Nõmme linnaosas.
